// Initialise datasets, dimensions and groups

var symptomsDataset = crossfilter(symptomsCases);
var allSymptoms = symptomsDataset.groupAll();
var symptomsDimension = symptomsDataset.dimension(function (d) { return d.symptom; });
var symptomsGroup = symptomsDimension.group();

var syndromesDataset = crossfilter(syndromesCases);
var allSyndromes = syndromesDataset.groupAll();
var syndromesDimension = syndromesDataset.dimension(function (d) { return d.syndrome; });
var syndromesGroup = syndromesDimension.group();



// Symptoms and syndromes row charts

var buildRowChart = function(target, dimension, group) {
  return dc.rowChart(target)
    .width(320)
    .height(200)
    .margins({top: 20, left: 10, right: 10, bottom: 20})
    .group(group)
    .dimension(dimension)
    .label(function (d) {
      return d.key;
    })
    .title(function (d) {
      return d.value
    })
    .elasticX(true);
};

var symptomsChart = buildRowChart('#symptomsChart', symptomsDimension, symptomsGroup);
var syndromesChart = buildRowChart('#syndromesChart', syndromesDimension, syndromesGroup);


// Data count widget

var symptomsCountChart = dc.dataCount('#symptomsCount').dimension(symptomsDataset).group(allSymptoms);
var syndromesCountChart = dc.dataCount('#syndromesCount').dimension(syndromesDataset).group(allSyndromes);


// Go!

dc.renderAll();
